  mousemoves = () => {alert(this.state.name)}

render(){
    return (
      <div className="app">
        <Child/>

        <button onClick={this.handleClick}>Click Me</button>

        <button onMouseMove={this.mousemoves}>Mouse Movingggg</button>
      </div>
    );
  }
}
